import heapq

def solver(nums, k, memo = {}): 
    # k is the start position, then explore left and right 
    # make res, update max(res, new)
    # cache (local_min, local_max)
    # local min
    def check_left(l, r):
        if (l,r) in memo: 
            return memo[(l,r)][-1]
        local_min = min(
            nums[l], memo[(l+1, r)][0]
        ) 
        result = max(local_min * (r - l + 1), memo[(l + 1, r)][-1])
        memo[(l,r)] = (local_min, result)
        return result
        
    def check_right(l, r): 
        if (l,r) in memo: 
            return memo[(l,r)][-1]
        local_min = min(
            nums[r], memo[(l, r - 1)][0]
        ) 
        result = max(local_min * (r - l + 1), memo[(l, r - 1)][-1])
        memo[(l,r)] = (local_min, result)
        return result
    
    def explore(l,r): 
        if l == r: 
            memo[(l,r)] = (nums[l], nums[l])
        res = 0 
        for i in range(k): 
            index = k - i - 1
            res = max(check_left(index, l), res)
        for i in range(k+1, len(nums)): 
            for j in range(k + 1): 
                res = max(res, check_right(j, i))
        return res
    return explore(k,k)


